import './App.css';
import {BrowserRouter,Route,Routes}from "react-router-dom"

function App() {
  return (
    <div id="main">
      <BrowserRouter>
        <Routes>
          <Route />
          <Route />
          <Route />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
